import React, { useState } from 'react';
import axios from 'axios';

function App() {
  const [meetingLink, setMeetingLink] = useState('');

  const joinZoomMeeting = async () => {
    try {
      const response = await axios.post('/joinZoomMeeting', { meetingLink });
      console.log('Joined Zoom meeting:', response.data);
    } catch (error) {
      console.error('Failed to join Zoom meeting:', error);
    }
  };
 
  return (
    <div>
      <h1>Zoom Bot</h1>
      <input
        type="text"
        value={meetingLink}
        onChange={(e) => setMeetingLink(e.target.value)}
        placeholder="Enter Zoom Meeting Link"
      />
      <button onClick={joinZoomMeeting}>Join Meeting</button>
    </div>
  );
}

export default App;
